window.bookSummaryJSON = "<p>“I inhaled this sexy, gritty, thrilling new series and I can’t wait for more!” (Lara Adrian, <i>New York Times</i> best-selling author)</p> <p>I knew the minute I saw him that Levi Agozi was too perfect to be real. I didn't care. He came to me, asked for me, and, dazzled by his dark good looks and the bad-boy aura surrounding him, I gave in. Willingly.</p> <p>My father is set to become the next governor of Georgia, and he'll use me to get there if he has to. He'll hand me over to the man with the biggest bank account and political pull.</p> <p>I wanted something more.</p> <p>I wanted Levi. And I had him - until I woke up, disoriented and confused, at his mercy. He’s a bad boy, all right. A sexy, <i>deadly</i> assassin. And I'm the pawn torn between him and my father, two powerful men intent on destroying each other.</p> <p>I might not understand their war, but I do understand one thing: No matter who wins, I lose.</p> <p>With duet narration</p>"; 
